import XMLData from "./carsData/Cars.xml"
import axios from "axios";

function Xml() {
    axios.get(XMLData, {
        "Content-Type": "application/xml; charset=utf-8"
    })
        .then((response) => {
            console.log('ini data xml', response.data);

        });



    // <table>
    //     <thead>
    //         <tr>
    //             <th>Id</th>
    //             <th></th>
    //             <th></th>
    //         </tr>
    //     </thead>
    // </table>
}


export default Xml;
